I am trying to change the background color of an adaptive card in bot framework. I have tried the following code but it is not working.

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "#000000"
  }
}
```

## Answer (1)

You can use the `style` property to set the background color of the card. Here is an example:

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "#000000"
  }
}
```

